import React, { Component } from 'react';
import Pastel from '../images/pastel.jpg';

export default class LatestCollection extends Component {
  constructor(props) {
    super(props);
    this.state = {
      recentItems: [
        { image: Pastel, title: 'Pastel', price: 450, sku: 2342323 },
        { image: Pastel, title: 'Pastel', price: 450, sku: 23423233223 },
        { image: Pastel, title: 'Pastel', price: 450, sku: 2342223 }
      ]
    };
  }

  render() {
    return (
      <div>
        <div className='latestHeader'>
          <p>Latest Collection: </p>
        </div>
        <div className='latestContent'>
          {this.state.recentItems.map((item, index) => {
            return (
              <div
                key={item.sku}
                className={
                  index % 2 === 0
                    ? 'latestContent_item'
                    : 'latestContent_item-odd'
                }
              >
                <div>
                  <img
                    src={item.image}
                    alt='the art '
                    className='latestContent_item-img'
                  />
                  <p className='latestContent_item_title'>{item.title}</p>
                  <p className='latestContent_item_price'>{`$${item.price}`}</p>
                </div>
                <div className='latestContent_item_description'></div>
              </div>
            );
          })}
        </div>
      </div>
    );
  }
}
